import React from 'react'
import './shimmer.'
const Shimmer = () => {
    return (
        <div className="restaurant-list">
          {Array(10)
            .fill("")
            .map((e, index) => (
              <div key={index} className="shimmer-card"></div>
            ))}
        </div>
      );
    };

export default Shimmer
